import path from "path";
import { defineConfig } from "umi";

export default defineConfig({
  dynamicImport: {
    loading: "@/components/LoadingCp"
  },
  dva: {
    immer: true
  },
  devtool: "source-map",
  antd: {},
  title: "趣谈前端-h5-dooring",
  // exportStatic: {},
  base: "/",
  publicPath: "/",
  outputPath: "dist",
  esbuild: {},
  routes: [
    {
      exact: false,
      path: "/",
      component: "@/layouts/index",
      routes: [
        {
          path: "/",
          component: "../pages/home"
        },
        {
          path: "/editor",
          component: "../pages/editor"
        },
        {
          path: "/ide",
          component: "../pages/ide"
        },
        {
          path: "/help",
          component: "../pages/help"
        },
        {
          path: "/login",
          component: "../pages/login"
        },
        {
          path: "/mobileTip",
          component: "../pages/mobileTip"
        },
        {
          path: "/preview",
          component: "../pages/editor/preview"
        }
      ]
    }
  ],
  theme: {
    "primary-color": "#2F54EB"
    // "btn-primary-bg": "#2F54EB"
  },
  extraBabelPlugins: [["import", { libraryName: "zarm", style: true }]],
  // sass: {},
  alias: {
    components: path.resolve(__dirname, "src/components/"),
    utils: path.resolve(__dirname, "src/utils/"),
    assets: path.resolve(__dirname, "src/assets/")
  }
});

const Koa = require("koa");
const { resolve } = require("path");
const staticServer = require("koa-static");
const koaBody = require("koa-body");
const cors = require("koa2-cors");
const logger = require("koa-logger");

const app = new Koa();

app.use(staticServer(resolve(__dirname, "./static")));
app.use(koaBody());
app.use(logger());

// 设置跨域
app.use(
  cors({
    origin: function(ctx) {
      if (ctx.url.indexOf("/dooring") > -1) {
        return "*"; // 允许来自所有域名请求
      }
      return "";
    },
    exposeHeaders: ["WWW-Authenticate", "Server-Authorization", "x-test-code"],
    maxAge: 5, //  该字段可选，用来指定本次预检请求的有效期，单位为秒
    credentials: true,
    allowMethods: ["GET", "POST", "PUT", "DELETE", "OPTIONS"],
    allowHeaders: [
      "Content-Type",
      "Authorization",
      "Accept",
      "x-requested-with",
      "Content-Encoding"
    ]
  })
);

let htmlStr = "";

app.use(async (ctx, next) => {
  console.log(ctx.url);
  if (ctx.url === "/dooring/render") {
    htmlStr = ctx.request.body;
    ctx.body = "success";
  } else if (ctx.url.indexOf("/html") === 0) {
    ctx.type = "html";
    ctx.body = htmlStr;
  }
});

app.listen(3000);

/**
 * 不是真实的 webpack 配置，仅为兼容 webstorm 和 intellij idea 代码跳转
 * ref: https://github.com/umijs/umi/issues/1109#issuecomment-423380125
 */

module.exports = {
  resolve: {
    alias: {
      "@": require("path").resolve(__dirname, "src")
    }
  }
};
